import React, { Component } from "react";
import Iframe from "react-iframe";

export default class Archrenderings extends Component {
  render() {
    return (
      <div>
        <Iframe
          url="https://vimeo.com/364942210"
          width="450px"
          height="450px"
          id="myId"
          className="myClassname"
          display="initial"
          position="relative"
        />

        <h1>park</h1>
      </div>
    );
  }
}
